    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1956. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
    reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. Resource management is outlined; topics include
    grazing. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, and Refuge participation. Items of interest, N-R forms, and photographs
    are attached. A short narrative report of North Platte National Wildlife Refuge
    is included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
